const createMnemonicStyle = {
    container: {
        width: "auto",
        marginTop:"100px",
        marginLeft:"28px",
        color: "#FFFFFF",
        overflow: "hidden",
        position: "relative",
        display: "flex",
        alignItems: "center",
    },

    box_container: {
        "@media (min-width: 576px)": {
            maxWidth: "140px",
        },
        "@media (min-width: 768px)": {
            maxWidth: "120px",
        },
        "@media (min-width: 992px)": {
            maxWidth: "160px",
        },
        "@media (min-width: 1200px)": {
            maxWidth: "1140px",
        },
    },
};

export default createMnemonicStyle;
